  background: #f2f4f7;
  height: 100vh;
  font-family: 'Overpass', Regular;
`;

class About extends Component {
  render() {
    return (
      <Container>
        <Header />
        <p>ABOUT HEIN</p>
      </Container>
    );
  }
}

export default About;
